import React, { Component } from 'react';

import styled from 'styled-components';
import Card from '../components/card'
import Judul from '../component/B'
import Waktu from '../component/C'

const Name = styled.h1`
 color:white;
 font-size: 20px;
 text-align: center;
`

class A extends Component {
   constructor(props) {
      super(props);
      this.state = {
         header: "TUGAS AKHIR PRAKTIKUM RSBK",
         isi: "KELOMPOK 9"
      }
   }
   componentDidMount() {
      alert(`Tugas Akhir Kelompok 9`)
   }
   render() {
      return (
         <div>
            <header className="App-header">
               <Name>{this.state.header}</Name>
               <Name>{this.state.isi}</Name>

               <div>
                  <Card />
               </div>
               <div>
                  <Judul />
               </div>
               <div>
                  <Waktu />
               </div>
            </header>

         </div>
      );
   }
}

export default A;
